import { width } from 'cli';
import logo from '../logo.svg';
import Shop from './Shop';

export default function Navbar() {
    return (
        <nav>
            <img src={logo} alt="description" />
            <div><Shop/></div>
            <div>CONTACT</div>
            <div>MY ACCOUNT</div>
            <div>LOGIN</div>
        </nav>
        
    )
}
